import React from "react";
import logo from "./logo.png";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

const Dashboard = () => {
  const navigate = useNavigate();

  // Mock data for documents
  const documents = [
    { id: 1, name: "Document 1", status: "draft" },
    { id: 2, name: "Document 2", status: "finalized" },
    { id: 3, name: "Document 3", status: "draft" },
    { id: 4, name: "Document 4", status: "finalized" },
    { id: 5, name: "Document 5", status: "draft" },
  ];
  
  return (
    <>
      <div
        className="min-h-screen"
        style={{
          backgroundImage: "linear-gradient(120deg, #fdfbfb 0%, #ebedee 100%)",
        }}
      >
        {/* Navigation Bar */}
        <motion.div
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
          className="fixed w-full bg-white shadow-md p-4 flex justify-between items-center"
        >
          <div className="flex items-center">
            <img
              src={logo} // Replace with your logo URL
              alt="Logo"
              className="h-10 w-20 mr-3"
            />
            <span className="text-2xl font-bold text-purple-600">Dashboard</span>
          </div>
          <div className="flex items-center">
            <span className="text-lg font-semibold text-gray-700 mr-4">
              Username
            </span>{" "}
            {/* Replace 'Username' with actual username */}
            <button
              className="text-white bg-purple-600 hover:bg-purple-700 focus:ring-4 focus:outline-none focus:ring-purple-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-purple-600 dark:hover:bg-purple-700 dark:focus:ring-purple-800"
              onClick={() => navigate("/")}
            >
              Log out
            </button>
          </div>
        </motion.div>

        {/* Main Content */}
        <motion.div
          initial={{ opacity: 0, x: 50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
          className="pt-20 flex flex-col items-center justify-center pb-5"
        >
          <motion.div
            initial={{ opacity: 0, scale: 0 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            className="flex justify-center items-center pb-5 pt-5"
          >
            <h1 className="text-4xl font-bold text-purple-600">Documents Page</h1>
          </motion.div>
          
          <div className="pb-2 flex justify-start w-full pl-5 mb-2">
            <h2 className="text-lg font-semibold text-blue-500">Drafts</h2>
          </div>
          <div className="grid justify-center items-center grid-cols-3 gap-6">
            {documents.filter(doc => doc.status === "draft").map((doc) => (
              <motion.div
                key={doc.id}
                className="bg-blue-200 border-2px border-black rounded-sm relative shadow-lg"
                style={{
                  width: "400px",
                  height: "200px",
                  padding: "24px",
                }}
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
              >
                <p className="text-5xl text-blue-500">{doc.name}</p>
                <div className="absolute bottom-0 left-0 right-0 bg-white bg-opacity-75 py-2 px-4 flex items-center justify-center">
                  <svg
                    className="h-6 w-6 text-blue-500 mr-2"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M12 6v6m0 0v6m0-6h6m-6 0H6"
                    />
                  </svg>
                  <p className="text-sm text-gray-900 font-semibold italic">
                    Draft
                  </p>
                </div>
              </motion.div>
            ))}
          </div>

          <div className="pb-2 flex justify-start w-full pl-5 mb-2">
            <h2 className="text-lg font-semibold text-purple-600">Finalized</h2>
          </div>
          <div className="grid justify-center items-center grid-cols-3 gap-6">
            {documents.filter(doc => doc.status === "finalized").map((doc) => (
              <motion.div
                key={doc.id}
                className="bg-purple-500 border-2px border-black rounded-sm relative shadow-lg"
                style={{
                  width: "400px",
                  height: "200px",
                  padding: "24px",
                }}
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
              >
                <p className="text-5xl text-white">{doc.name}</p>
                <div className="absolute bottom-0 left-0 right-0 bg-white bg-opacity-75 py-2 px-4 flex items-center justify-center">
                  <svg
                    className="h-6 w-6 text-green-500 mr-2"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M5 13l4 4L19 7"
                    />
                  </svg>
                  <p className="text-sm text-gray-900 font-semibold italic">
                    Finalized
                  </p>
                </div>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </>
  );
};

export default Dashboard;
